import * as React from 'react';
import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogTitle from '@mui/material/DialogTitle';
import { Box } from '@mui/system';
import { FormControl, InputLabel, MenuItem, Select } from '@mui/material';
import cryptoData from "../../data";

export default function DialogBox(props) {

  return (
    <div>
      <Dialog open={props.open} onClose={props.handleClose}>
        <Box sx={{ backgroundColor: "rgb(15, 73, 63)", p: 1 }}>
          <DialogTitle color="white">Exchange Crypto With</DialogTitle>
          <DialogContent sx={{ color: 'white' }}>
            <FormControl fullWidth>
              <InputLabel id="demo-simple-select-label" color="white">Choose Crypto</InputLabel>
              <Select
                labelId="demo-simple-select-label"
                id="demo-simple-select"
                // value={age}
                label="Age"
                // onChange={handleChange}
              >
                <MenuItem value={10}>Ten</MenuItem>
                <MenuItem value={20}>Twenty</MenuItem>
                <MenuItem value={30}>Thirty</MenuItem>
              </Select>
            </FormControl>
            <TextField
              autoFocus
              margin="dense"
              id="name"
              label="Crypto Quantity"
              type="number"
              fullWidth={true}
              variant="standard"
            />
          </DialogContent>
          <DialogActions>
            <Button variant="contained" onClick={props.handleClose}>Cancel</Button>
            {/* <Button onClick={props.handleSubmit, props.handleClose}>Submit</Button> */}
            <Button variant="contained" onClick={() => { props.handleSubmit(); props.handleClose(); }}>Submit</Button>
          </DialogActions>
        </Box>
      </Dialog>
    </div>
  );
}
